import React, { useState } from 'react';
import {
  AppBar,
  Toolbar,
  Typography,
  IconButton,
  Drawer,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
  CssBaseline,
  Box,
  Menu,
  MenuItem,
  Button
} from '@mui/material';
import CloseIcon from '@mui/icons-material/Close';
import MenuIcon from '@mui/icons-material/Menu';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import '../css/Dashboard.css'; // Import the CSS file
import backgroundVideo from '../images/backgroundvideo.mp4'; // Import the video file
import Preloader from '..//Preloader'; // Import the Preloader component

const theme = createTheme({
  palette: {
    mode: 'dark',
    primary: {
      main: '#90caf9',
    },
    secondary: {
      main: '#f48fb1',
    },
    background: {
      default: '#000',
      paper: '#121212',
    },
    text: {
      primary: '#fff',
      secondary: '#b0bec5',
    },
  },
  typography: {
    h6: {
      fontSize: '1.25rem',
      fontWeight: 700,
      color: '#fff',
    },
  },
});

const Orgainzerdash = () => {
  const [drawerOpen, setDrawerOpen] = useState(false);
  const [anchorEl, setAnchorEl] = useState(null);
  const isMenuOpen = Boolean(anchorEl);
  const [advertiseOpen, setAdvertiseOpen] = useState(false);
  const username = 'John Doe'; // Example username

  const handleMenuOpen = (event) => {
    setAnchorEl(event.currentTarget);
  };

  const handleMenuClose = () => {
    setAnchorEl(null);
  };

  const handleLogout = () => {
    // Implement logout functionality here
    handleMenuClose();
  };

  const toggleAdvertiseSection = () => {
    setAdvertiseOpen(!advertiseOpen);
  };

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Preloader /> {/* Add the Preloader component here */}
      <AppBar position="fixed" className="appBar">
        <Toolbar>
          <IconButton edge="start" color="inherit" aria-label="menu" onClick={() => setDrawerOpen(!drawerOpen)} className="menuIcon">
            <MenuIcon />
          </IconButton>
          <Typography variant="h6" component="div" sx={{ flexGrow: 1 }} className="title">
            SportsZone
          </Typography>
          <Box sx={{ display: 'flex', alignItems: 'center' }}>
            <Typography variant="body1" className="username">
              {username}
            </Typography>
            <IconButton edge="end" color="inherit" aria-label="profile" onClick={handleMenuOpen} className="profileButton">
              <AccountCircleIcon />
            </IconButton>
          </Box>
          <Menu
            anchorEl={anchorEl}
            open={isMenuOpen}
            onClose={handleMenuClose}
            PaperProps={{
              sx: {
                backgroundColor: '#0A0A0A',
                color: '#fff',
              },
            }}
          >
            <MenuItem onClick={handleMenuClose}>Profile</MenuItem>
            <MenuItem onClick={handleMenuClose}>My Account</MenuItem>
            <MenuItem onClick={handleLogout}>Logout</MenuItem>
          </Menu>
        </Toolbar>
      </AppBar>
      <Drawer
        anchor="left"
        open={drawerOpen}
        onClose={() => setDrawerOpen(false)}
        PaperProps={{
          sx: {
            backgroundColor: '#0A0A0A',
            color: '#fff',
          },
        }}
        className="drawer"
      >
        <List sx={{ width: 250 }}>
          <ListItem button onClick={() => setDrawerOpen(false)} className="listItem">
            <ListItemIcon>
              <CloseIcon className="closeIcon" />
            </ListItemIcon>
          </ListItem>
          <ListItem button component="a" href="/home" className="listItem">
            <ListItemText primary="Home" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/about-us" className="listItem">
            <ListItemText primary="About us" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/partner" className="listItem">
            <ListItemText primary="Partner With Us" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/membership-management" className="listItem">
            <ListItemText primary="Membership Management" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/book-now" className="listItem">
            <ListItemText primary="Book Now" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/news-events" className="listItem">
            <ListItemText primary="News and Events" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/careers" className="listItem">
            <ListItemText primary="Careers" className="listItemText" />
          </ListItem>
          <ListItem button component="a" href="/blogs" className="listItem">
            <ListItemText primary="Blogs" className="listItemText" />
          </ListItem>
        </List>
      </Drawer>
      <Box className="mainContent">
        <Box className="videoBackground">
          <video autoPlay loop muted className="backgroundVideo">
            <source src={backgroundVideo} type="video/mp4" />
          </video>
        </Box>
        <Box className="overlay">
          <Typography variant="h3" className="headline">
            YOUR NEAREST SPORTS COMMUNITY
          </Typography>
          <Typography variant="h5" className="subheadline">
            IS JUST A TAP AWAY
          </Typography>
          <Button variant="contained" className="advertiseButton" onClick={toggleAdvertiseSection}>
            Advertise Tournament
          </Button>
        </Box>
      </Box>
      <Box className={`advertiseSection ${advertiseOpen ? 'open' : ''}`}>
        <Typography variant="h4">Advertise Your Tournament</Typography>
        <Typography variant="body1">Promote your tournament and reach a wider audience. Fill out the form below to get started.</Typography>
        {/* Add form or content for advertising here */}
        <Button variant="contained" className="registerButton" onClick={() => alert('Register button clicked')}>
          Register
        </Button>
      </Box>
      <Box className="playSpotsPresenceSection">
        <img src="/path/to/Screenshot2024-07-26-122054.png" alt="PlaySpots Presence" className="playspotsImage" />
        <Typography variant="h4">PlaySpots has presence in 150+ cities across India</Typography>
        <Typography variant="body1">Join with the largest sports ground management solution.</Typography>
      </Box>
    </ThemeProvider>
  );
};

export default Orgainzerdash;
